class Coating2
{

  price = 0;
  //coating_add_price = 0;
  

  constructor($order_spec) {
    this.maesu    = $order_spec.quantity;
    this.quantity = $order_spec.count_case;
    this.cutwidth = $order_spec.width;
    this.cutheight =  $order_spec.height;
    this.pan = $order_spec.paper_val;
    
    this.width2 = Number($order_spec.cut_size_w);
    this.height2 = Number($order_spec.cut_size_h);
    
    this.set_price('단면무광', 'indigo7000' );
  }

	  
  set_price(coating, machine) {
	  
	  var table = $_coating_price;
      let obj = _.find(table, function(o) {
        return (o.name == coating);
      });
      
      const p = obj['price'];

      var m = ( this.cutwidth / 1000) * ( this.cutheight / 1000) * p;
      m = Math.ceil(m / 10) * 10;
	  
      table = $_coating_add_price;
      obj = _.find(table, function(o) {
        return (o.name == coating && o.machine == machine);
      });
      this.coating_add_price = obj['price'];


      table = $_coating_job_price;
      obj = _.find(table, function(o) {
        return (o.name == coating && o.machine == machine);
      });
      this.coating_job_price = obj['price'];
      
      const v1 = Math.floor(this.cutwidth/ this.width2);
      const v2 = Math.floor(this.cutheight / this.height2);
      const v3 = Math.floor(this.cutwidth / this.height2);
      const v4 = Math.floor(this.cutheight / this.width2);

      
	  const dd =   Math.max(  Number(v1) * Number(v2) , Number(v3) * Number(v4) );
      const q_maesu =  (this.maesu * this.quantity) / dd;

      const p1 = (m + this.coating_job_price) * q_maesu + this.coating_add_price;
      const p2 = Math.ceil(p1 / 100) * 100;
      this.coating_price = p2;

      this.price = p2;
  }

  get get_price() {
    const p1 = Math.round(this.price / 100) * 100;
    return p1;
  }	  
}